def __create_logger(path):
    '''
    Creates Timed Rotating Log
    '''
    logger = logging.getLogger("Rotating Log")
    logger.setLevel(logging.INFO)
    
    handler = TimedRotatingFileHandler(path,
                                       when="m",
                                       interval=10080,
                                       backupCount=5)
    logger.addHandler(handler)

    return logger


